import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    boxShadow: "none",
    border: 'none',
    outline: 'none',
    backgroundColor: 'red'
  }
}));

export default function Header() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <AppBar position="fixed" elevation={0} style={{backgroundColor: "#1A1723", border: "none", outline: "none", boxShadow: "none"}}>
        <Toolbar style={{backgroundColor: "#1A1723", border: "none", outline: "none", boxShadow: "none"}}>
          <p className="headerTitle">Battie boys</p>
        </Toolbar>
      </AppBar>
    </div>
  );
}
